Syntax:

<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style>
        /*first-child*/
        /*nth-child*/
        li:first-child {
            color: blue;
        }

        li:nth-child(3) {
            color: red;
        }

        li:nth-child(2) {
            color: orange;
        }

        li:last-child {
            background-color: green;
        }

        div:hover {
            background-color: blue;
            border-radius: 50%;
        }

        div:nth-child(3):hover {
            border-radius: 50%;
            width: 443px;
            height: 443px;
        }

        div {
            background-color: white;
            margin: 20px;
            width: 200px;
            height: 200px;
            float: left;

        }
    </style>
</head>
